      function buildCalendar() {
        var startMillis = 1735718400000;
        var millis = Date.now();
        var num = Math.floor((millis - startMillis) / 1000 / 60 / 60 / 24);
        for (var i = 19; i <= num && i <= 1479; i++) {
          document.getElementById("day" + i).style.backgroundColor = "#AFE1AF";
        }
      }
      buildCalendar();
    </script>
